INSERT INTO `sw_goods` VALUES (2018071914192276054826401956,'新闻资讯','新闻资讯',2018071911696975951892068518,'阿打算的发送到发送到,阿斯顿发送到发生地方,阿斯顿发送到发送到发的,阿斯顿发送到发生地方萨达是地方,似懂非懂泛塞封',0,'<p style=\"white-space: normal; text-indent: 2em; line-height: 1.5em;\"><span style=\"color: rgb(102, 102, 102); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">2018年3月29日下午，入住在房山区养老服务指导中心李爷爷的家人专程来到位于房山区公园北路9号院的房山区养老服务指导中心送上锦旗，称赞照料中心的医护人员是“敬老养老功德无量，不是儿女胜似儿女”。</span></p><p style=\"white-space: normal; text-indent: 2em; line-height: 1.5em;\"><span style=\"color: rgb(102, 102, 102); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\"><br/></span></p><p style=\"white-space: normal; text-align: center;\"><img alt=\"我与房山区养老服务指导中心相遇在暮色年华\" src=\"http://info.ucs-group.cn/uploads/allimg/180329/1-1P3291R103226.jpg\" width=\"574\" height=\"398\"/></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-family: Arial, 宋体; font-weight: 700; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">图为李爷爷家人给房山区养老服务指导中心送锦旗</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"color: rgb(102, 102, 102); font-family: Arial, 宋体; font-weight: 700; background-color: rgb(255, 255, 255);\">（中间：房山区民政局局长：韩士军，左二：小康之家集团总经理：王宁，右二：小康之家集团副总经理：姜飞）</span></p><p style=\"white-space: normal;\"><span style=\"background-color: rgb(240, 247, 253); color: rgb(102, 102, 102); font-family: Arial, 宋体; font-weight: 700;\"><br/></span></p><p style=\"white-space: normal; text-indent: 2em; line-height: 1.5em;\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(102, 102, 102); font-family: Arial, 宋体;\">李爷爷是第一批入住指导中心的长者之一，14岁参加革命，南征北战了大半辈子，虽然已经95岁高龄了，但是身体还是格外的健朗。爷爷在机构的生活也是非常有规律的。清晨，用完早餐后，由护理人员陪伴，在花园里散散步，呼吸新鲜的空气。随后护理人员和康复师会来接爷爷去康复训练室和检查室进行日常生命体征监测以及身体肌能训练。通过训练可以强化身体肌能，促进新陈代谢及血液循环系统。</span><br/><span style=\"color: rgb(102, 102, 102); font-family: Arial, 宋体;\">平日里跟老伙伴们和护理人员下下棋、聊聊天。晚饭过后，护理人员会为李爷爷按摩按摩身体、用中药泡脚，促进血液循环，缓解一天的疲劳，让爷爷可以安心入睡。用爷爷的话说：“这里医护人员把我照顾的像家人一样。”</span></span></p><p style=\"white-space: normal; text-align: center;\"><img alt=\"我与房山区养老服务指导中心相遇在暮色年华\" src=\"http://info.ucs-group.cn/uploads/allimg/180329/1-1P3291R14C95.jpg\" width=\"560\" height=\"399\"/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal; text-indent: 2em; line-height: 1.5em;\"><span style=\"color: rgb(102, 102, 102); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">3月18日李爷爷在机构中度过了自己95岁的寿辰。爷爷在给房山区养老服务指导中心的感谢信中写到：我有幸在暮年来到这里，认识你们，在党和国家、政府的决策下，认识到了养老事业的重要性，同时，感谢这里的领导们、护理人员们，是你们的辛勤付出，不怕苦、不怕脏、不怕累照顾这里的老弱病残的长者们，让我们在这里可以安度晚年。“</span></p><p style=\"white-space: normal; text-indent: 2em; line-height: 1.5em;\"><span style=\"color: rgb(102, 102, 102); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\"><br/></span></p><p style=\"white-space: normal; text-align: center; text-indent: 2em;\"><img alt=\"我与房山区养老服务指导中心相遇在暮色年华\" src=\"http://info.ucs-group.cn/uploads/allimg/180329/1-1P3291R2024c.jpg\" width=\"568\" height=\"437\"/></p><p style=\"white-space: normal; text-indent: 2em;\"><span style=\"color: rgb(102, 102, 102); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">房山区养老服务指导中心以周到贴心的服务，为长者们提供幸福和谐的居养环境，全方位提升长者们的生活品质。</span></p><p style=\"white-space: normal;\"><span style=\"color: rgb(102, 102, 102); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\"><br/></span></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><br/></p><p><br/></p>',0x01,0x01,'2018-07-19 13:55:56',1,0,1),(2018071915971876113318700965,'test1','新闻资讯',2018071911696975951892068518,NULL,0,NULL,0x01,0x01,'2018-07-19 15:33:53',2,0,2);
