CREATE DEFINER=`root`@`localhost` PROCEDURE `get_user_group`(IN PID decimal(28),IN UID decimal(28))
    COMMENT '\r\n\r\nTID   --- TeamID\r\nUID  ---  UserID'
BEGIN
	#获取项目组
	#TID  项目组ID
	#PID  项目ID 或者数据集ID
	#UID  用户ID
	#Status  项目组状态
	#定义 变量  
DECLARE Id DECIMAL (28);

#DECLARE variable_id DECIMAL (28);
#这个用于处理游标到达最后一行的情况  
DECLARE s INT DEFAULT 0;

#身份 2:所有者  1:管理者  0:参与者  -1:没有在项目组中
DECLARE Identity INT DEFAULT - 1;

#声明游标cursor_name（cursor_name是个多行结果集）  
DECLARE cursor_name CURSOR FOR SELECT
	team.TeamID
FROM
	user_team team
LEFT JOIN user_team_rel utr ON utr.TeamID = team.TeamID
WHERE
	ProjectID = PID
AND team.`Status` = 1 and utr.IsSee = 1 and utr.UserID = UID;

#设置一个终止标记   
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000'
SET s = 1;


SET max_sp_recursion_depth = 100;

DROP TABLE
IF EXISTS list;

CREATE TEMPORARY TABLE list (list_id DECIMAL(28) NOT NULL);

#打开游标  
OPEN cursor_name;

#获取游标当前指针的记录，读取一行数据并传给变量a,b  
FETCH cursor_name INTO Id;

#开始循环，判断是否游标已经到达了最后作为循环条件   
WHILE s <> 1 DO

IF (Id IS NOT NULL) THEN
	INSERT INTO list (list_id)
VALUES
	(Id);

CALL get_team_child (Id, 1);


END
IF;

FETCH cursor_name INTO Id;


END
WHILE;

#关闭游标  
CLOSE cursor_name;

SELECT
	CASE
WHEN t.UserID = UID THEN
	2
WHEN utr.UserID = UID
AND utr.Identity = 1 THEN
	1
WHEN utr.UserID = UID THEN
	0
ELSE
	- 1
END AS Identity INTO Identity
FROM
	user_team t
LEFT JOIN user_team_rel utr ON utr.TeamID = t.TeamID
WHERE
	t.ProjectID = PID
AND Type = 2
GROUP BY
	t.TeamID,
	Identity;

#获取用户组
SELECT
	TeamID,
	TeamName,
	ProjectName,
	ProjectID,
	UserID,
	ParentID,
	Remark,
	Type,
	Sort,
	STATUS
FROM
	user_team
WHERE
	TeamID IN (SELECT list_id FROM list);

#获取用户组的样本权限
SELECT
	s.*, sr.TeamID
FROM
	limit_sample_info s
LEFT JOIN team_sample_rel sr ON sr.SampleID = s.SampleID
WHERE
	sr.TeamID IN (SELECT list_id FROM list);

#获取用户组的变量权限
SELECT
	lvi.*, tvr.TeamID
FROM
	limit_variable_info lvi
LEFT JOIN team_variable_rel tvr ON tvr.VariableID = lvi.VariableID
WHERE
	tvr.TeamID IN (SELECT list_id FROM list);

#获取用户组的成员列表
SELECT
	u.*, utr.TeamID,
	utr.Identity AS TeamIdentity
FROM
	user_info u
LEFT JOIN user_team_rel utr ON utr.UserID = u.UserID
AND utr.IsSee = 0
WHERE
	utr.TeamID IN (SELECT list_id FROM list)
AND utr. STATUS != 2 && utr. STATUS != 3;

DROP TABLE list;

#语句执行结束  
END ;;
