CREATE DEFINER=`root`@`localhost` PROCEDURE `get_user_team`(IN TID DECIMAL(28),IN PID DECIMAL(28),IN UID DECIMAL(28),IN Status INT)
BEGIN
	#获取项目组
	#TID  项目组ID
	#PID  项目ID 或者数据集ID
	#UID  用户ID
	#Status  项目组状态
	#定义 变量  
DECLARE Id DECIMAL (28);

#DECLARE variable_id DECIMAL (28);
#这个用于处理游标到达最后一行的情况  
DECLARE s INT DEFAULT 0;

#声明游标cursor_name（cursor_name是个多行结果集）  
DECLARE cursor_name CURSOR FOR SELECT
	team.TeamID
FROM
	user_team team
LEFT JOIN user_team_rel utr ON utr.TeamID = team.TeamID
WHERE
	(
		team.TeamID = TID
		OR team.ProjectID = PID
	)
AND (
	team.UserID = UID
	OR (
		utr.UserID = UID
		AND utr.Identity = 1
		AND utr.`Status` = 1
		AND utr.IsSee = 1
	)
	OR (
		utr.UserID = UID
		AND utr.Identity = 0
		AND utr.`Status` = 1
		AND utr.IsSee = 1
	)
)
AND team.`Status` = STATUS;

#设置一个终止标记   
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000'
SET s = 1;


SET max_sp_recursion_depth = 100;

DROP TABLE
IF EXISTS list;

CREATE TEMPORARY TABLE list (list_id DECIMAL(28) NOT NULL);

#打开游标  
OPEN cursor_name;

#获取游标当前指针的记录，读取一行数据并传给变量a,b  
FETCH cursor_name INTO Id;

#开始循环，判断是否游标已经到达了最后作为循环条件   
WHILE s <> 1 DO

IF (Id IS NOT NULL) THEN
	INSERT INTO list (list_id)
VALUES
	(Id);

CALL get_team_child (Id, STATUS);


END
IF;

FETCH cursor_name INTO Id;


END
WHILE;

#关闭游标  
CLOSE cursor_name;

SELECT
	utrm.MID,
	user_info.UserID,
	user_info.FullName,
	user_info.NickName,
	team.TeamID,
	team.TeamName,
	team.ProjectName,
	team.ProjectID,
	team.ParentID,
	team.UserCreate,
	team.UserID AS TeamUserID,
	utr. STATUS,
	team.Type,
	team.Sort,
	utr.Identity AS TeamIndextity,
	utr.Jurisdiction,
	utr.IsSee,
	utr.UserID AS aa
FROM
	user_team team
LEFT JOIN user_team_rel utr ON utr.TeamID = team.TeamID
LEFT JOIN user_info user_info ON user_info.UserID = utr.UserID
LEFT JOIN user_team_rel_message utrm ON utrm.TeamID = team.TeamID
AND utrm.InvitedPersonId = user_info.UserID
AND utrm.Type = 2
WHERE
	team.TeamID IN (SELECT list_id FROM list);

DROP TABLE list;

#语句执行结束  
END ;;
