CREATE DEFINER=`root`@`localhost` PROCEDURE `get_user_team_sample`(IN PID DECIMAL(28),IN UID decimal(28),IN IsAll bit(1))
BEGIN
	#获取样本限制
	#定义 变量  
DECLARE Id DECIMAL (28);

DECLARE tCount INT DEFAULT 0;

#DECLARE variable_id DECIMAL (28);
