INSERT INTO list2 (list_id) SELECT
	list_id
FROM
	list;

CALL get_user_team_sample_2 (UID);

END
IF;

SELECT count(1) into tCount from  user_team_rel utr 
LEFT JOIN user_team team on team.TeamID = utr.TeamID 
 where utr.TeamID in (SELECT list_id FROM list) and utr.IsSee = 1 and utr.UserID = UID and team.Type=2 and team.TeamID = team.DataTeamID;

IF (tCount>0) THEN
