	s.VariableType AS Type,
	s.SampleNo,
	s.SampleType,
	s.OperatorTwo,
	utr.IsSee,
	utr.`Status`
FROM
	user_team team
LEFT JOIN team_sample_rel sr ON team.TeamID = sr.TeamID
LEFT JOIN limit_sample_info s ON sr.SampleID = s.SampleID
LEFT JOIN user_team_rel utr ON utr.TeamID = team.TeamID
AND utr.UserID = UID
AND IsSee = 0
WHERE
	team.TeamID IN (SELECT list_id FROM list)
AND team.Type IN (2, 3)
GROUP BY
	team.TeamID,
	team.TeamName,
	s.`Key`,
	Operator,
	`Value`;

END IF;


DROP TABLE
IF EXISTS list2;

DROP TABLE list;

#语句执行结束  
END ;;
