CREATE DEFINER=`root`@`localhost` PROCEDURE `move_down_user_team`(IN TID DECIMAL(28),IN MoveType INT)
    COMMENT '\r\n\r\n上移下移\r\nTID  项目组ID\r\nMoveType  1:上移   2:下移'
BEGIN #上移下移
#TID  项目组ID
#MoveType  1:上移   2:下移

DECLARE PID DECIMAL (28);
DECLARE TID2 DECIMAL (28);
DECLARE Sort1 INT DEFAULT 0;
DECLARE Sort2 INT DEFAULT 0;

SELECT Sort,ParentID into Sort1,PID FROM user_team where TeamID = TID;

IF (PID is not null AND Sort1 is not null) THEN
	IF(MoveType =1) THEN
			select TeamID,Sort into TID2,Sort2 FROM user_team where Type = 3 and ParentID = PID and Sort > Sort1 ORDER BY Sort LIMIT 1;
	ELSEIF MoveType = 2 THEN
		select TeamID,Sort into TID2,Sort2 FROM user_team where Type = 3 and ParentID = PID and Sort < Sort1 ORDER BY Sort DESC LIMIT 1;
		END IF;
END IF;

IF (PID is not null and TID2 is not null) THEN
	UPDATE user_team SET Sort = Sort2 where TeamID = TID;
	UPDATE user_team SET Sort = Sort1 where TeamID = TID2;
END IF;
 
END ;;
