CREATE DEFINER=`root`@`localhost` PROCEDURE `strings_to_decimal`(s_str TEXT, s_split varchar(3))
begin

  set @i = length(s_str) - length(replace(s_str,s_split,''));  -- 算出分隔符的总数
  set @left_str = s_str;
	drop table if exists list;
	create temporary table list(list_id decimal(28) not null);
  while @i>0                -- 有多少个分隔符就循环多少遍
  do 
  set @sub_str = substr(@left_str,1,instr(@left_str,s_split)-1);            -- 得到分隔符前面的字符串
  set @left_str = substr(@left_str,length(@sub_str)+length(s_split)+1);     -- 得到分隔符后面的字符串
  set @n = trim(@sub_str);
  insert into list(list_id) values(@n);
  set @i = @i - 1;      
  end while;
  set @n = trim(@left_str);
  insert into list(list_id) values(@n);
	
end ;;
